import React from "react";

function Jumbotron() {
    return (
        <div className="jumbotron jumbotron-fluid">
          <div className="container">
            <h2 className="display-4">Pretty Jumbotron</h2>
            <p className="lead">Will change for hw</p>
          </div>
        </div>
    );
}

export default Jumbotron;
